import logo from '../logo.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../Assets/home.css';
import { Button, ButtonGroup } from 'react-bootstrap';
function Home() {
  return (
    <div className='home'>
      <div className='inicio'>
        <ButtonGroup className='grupoBotones' vertical>
          <Button  className='botonInicio'>Paciente</Button>
          <Button className='botonInicio'>Medico</Button>
        </ButtonGroup>
      </div>

    </div>
  );
}

export default Home;
